INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アヤネ", 10046, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, 24001, "2030/12/17 14:59:59", 2, 102301, 0.0, 24, 401);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アヤネ", 10046, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 0.0, 24002, "2030/12/17 14:59:59", 2, 102301, 0.0, 24, 402);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アヤネ", 10046, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, 24003, "2030/12/17 14:59:59", 2, 102301, 0.0, 24, 403);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アサヒ", 10046, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 0.0, 24004, "2030/12/17 14:59:59", 1, 192201, 0.0, 24, 701);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アサヒ", 10046, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 0.0, 24005, "2030/12/17 14:59:59", 2, 192201, 0.0, 24, 702);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アサヒ", 10046, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 0.0, 24006, "2030/12/17 14:59:59", 1, 192201, 0.0, 24, 703);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "部員３", 10046, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, 24007, "2030/12/17 14:59:59", 2, 192301, 0.0, 24, 801);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "部員３", 10046, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 0.0, 24008, "2030/12/17 14:59:59", 2, 192301, 0.0, 24, 802);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "部員３", 10046, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, 24009, "2030/12/17 14:59:59", 2, 192301, 0.0, 24, 803);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "", 10046, 1, "やった！", 0.0, 0.0, 24010, "2030/12/17 14:59:59", 1, 192501, 0.0, 24, 501);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "", 10046, 1, "勝ったよ！", 0.0, 0.0, 24011, "2030/12/17 14:59:59", 1, 192501, 0.0, 24, 502);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "", 10046, 1, "いい調子！", 0.0, 0.0, 24012, "2030/12/17 14:59:59", 1, 192501, 0.0, 24, 503);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 0.0, 24013, "2030/12/17 14:59:59", 2, 113501, 0.0, 24, 111);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 0.0, 24014, "2030/12/17 14:59:59", 2, 113501, 0.0, 24, 112);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 0.0, 24015, "2030/12/17 14:59:59", 2, 113501, 0.0, 24, 113);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ダイチ", 10046, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 0.0, 24016, "2030/12/17 14:59:59", 2, 192401, 0.0, 24, 611);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ダイチ", 10046, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 0.0, 24017, "2030/12/17 14:59:59", 2, 192401, 0.0, 24, 612);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ダイチ", 10046, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, 24018, "2030/12/17 14:59:59", 2, 192401, 0.0, 24, 613);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ハツネ", 10046, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 0.0, 24019, "2030/12/17 14:59:59", 1, 113401, 0.0, 24, 211);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ハツネ", 10046, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 0.0, 24020, "2030/12/17 14:59:59", 1, 113401, 0.0, 24, 212);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ハツネ", 10046, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 0.0, 24021, "2030/12/17 14:59:59", 2, 113401, 0.0, 24, 213);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "カヤ", 10046, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 0.0, 24022, "2030/12/17 14:59:59", 2, 106501, 0.0, 24, 311);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "カヤ", 10046, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 0.0, 24023, "2030/12/17 14:59:59", 2, 106501, 0.0, 24, 312);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "カヤ", 10046, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 0.0, 24024, "2030/12/17 14:59:59", 1, 106501, 0.0, 24, 313);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アヤネ", 10046, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 0.0, 24025, "2030/12/17 14:59:59", 3, 102301, 0.0, 24, 421);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "アサヒ", 10046, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 0.0, 24026, "2030/12/17 14:59:59", 1, 192201, 0.0, 24, 721);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "部員３", 10046, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 0.0, 24027, "2030/12/17 14:59:59", 3, 192301, 0.0, 24, 821);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "", 10046, 1, "いい勝負だったよ\nまたやろうね", 0.0, 0.0, 24028, "2030/12/17 14:59:59", 1, 192501, 0.0, 24, 521);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 0.0, 24029, "2030/12/17 14:59:59", 2, 113501, -360.0, 24, 101);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 0.0, 24030, "2030/12/17 14:59:59", 2, 113501, -360.0, 24, 102);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 0.0, 24031, "2030/12/17 14:59:59", 2, 113501, -360.0, 24, 103);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 0.0, 24032, "2030/12/17 14:59:59", 1, 113501, -360.0, 24, 104);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2020/07/31 12:00:00", "ミサト", 10046, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 0.0, 24033, "2030/12/17 14:59:59", 2, 113501, -360.0, 24, 105);
